"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Aanbieder en gemeente weten op basis van de ingediende declaraties en de daarvan toegekende prestaties wat het bedrag is dat over een bepaalde periode door de gemeente moet worden uitbetaald. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
