"28141" : {
"id":28141,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV061: Hoe wordt een ononderbroken periode van zorglevering (hulpperiode) vertaald naar te declareren/factureren productperiodes in de prestatie?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Voor het declareren/factureren zijn de volgende begrippen van belang: &nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Hulpperiode: is een periode waarbinnen hetzelfde product conform de toewijzing geleverd is. Dit kan meerdere declaratie-/factuurperiodes beslaan en is clientgebonden.</li><li>Declaratie-/factuurperiode: is een administratieve periode waarbinnen de geleverde hulp in de administratie tot een declaratie of factuur wordt verwerkt. Dit is niet clientgebonden maar afhankelijk van de afspraak die hierover bestaat tussen de gemeente en de aanbieder.</li><li>Productperiode: is de begin- en einddatum van een geleverd product binnen de afgesproken declaratie-/factuurperiode. De productperiode valt altijd binnen de geldigheidsperiode van de toewijzing. De productperiode is clientgebonden en valt dus altijd binnen &#233;&#233;n declaratie-/factuurperiode.</ul>&nbsp;<p style=\"margin-top: 3pt;\">In het declaratie- of factuurbericht wordt het totale geleverde volume van &#233;&#233;n product binnen &#233;&#233;n productperiode aan &#233;&#233;n client opgenomen in &#233;&#233;n of meer Prestaties (afhankelijk van de methode die wordt gebruikt). Deze prestaties worden direct in de erop volgende declaratie-/factuurperiode, of eventueel achteraf in een latere declaratie-/factuurperiode, gedeclareerd of gefactureerd.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Methoden&nbsp;<p style=\"margin-top: 3pt;\"></b>Er zijn twee methodes om te declareren/facturen, te weten &quot;werkelijke productperiodes&quot; en &quot;som over declaratie-/factuurperiode&quot;. De regels per methode voor het vertalen van de hulpperiode naar &#233;&#233;n of meerdere productperiodes zijn beschreven in aparte invulinstructies IV062 en IV063.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Facturatie/Declaratie systematiek&nbsp;<p style=\"margin-top: 3pt;\"></b>Gemeenten en aanbieders kunnen (op grond van OP264) onderling afwijkende afspraken maken over de momenten waarop, al dan niet in delen, gedeclareerd of gefactureerd kan worden, in de situatie van een outputgericht product dat in euro's is toegewezen.<span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV061"}}}]
}
]
}
