"28022" : {
"id":28022,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV066: Wanneer krijgt een toewijzing een nieuw ToewijzingNummer?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Een initiele toekenning van een product aan een client is een nieuwe toewijzing en krijgt een nieuw toewijzingnummer. Een initiele toekenning kent nooit een RedenWijziging.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien een eerder afgegeven toewijzing gewijzigd wordt (intrekken, oprekken of corrigeren), wordt het ToewijzingNummer gevuld van de initiele toekenning. De start-, stop en declaratieberichten refereren naar het ToewijzingNummer uit het toewijzingbericht. Het (opnieuw) versturen van een bericht heeft geen invloed op ToewijzingNummer. &nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Let op: wijzigen van een toewijzing is slechts beperkt toegestaan:&nbsp;<p style=\"margin-top: 3pt;\">* de einddatum kan worden aangepast (Zie ook OP33x1)&nbsp;<p style=\"margin-top: 3pt;\">* het budget kan worden aangepast&nbsp;<p style=\"margin-top: 3pt;\">* de omvang kan worden aangepast indien de frequentie de waarde 6 (Totaal binnen geldigheidsduur toewijzing) heeft&nbsp;<p style=\"margin-top: 3pt;\">Indien de omvang bij andere frequenties dan &quot;Totaal binnen geldigheidsduur toewijzing&quot; gewijzigd wordt, betekent dat dat de bestaande toewijzing wordt ingetrokken en een nieuwe toewijzing wordt verzonden met als Ingangsdatum de datum waarop de gewijzigde omvang ingaat. Dit betreft dan een nieuwe initiele toekenning met een nieuw ToewijzingNummer. </span><span style=\" font-size: 10pt; font-family: Calibri;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV066"}}}]
}
]
}
