"28008" : {
"id":28008,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV055: Hoe moet worden omgegaan met debet en credit prestaties in een declaratie- of factuurbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Debet en credit prestaties kunnen in &#233;&#233;n declaratie- of factuurbericht worden aangeleverd. Hierbij geldt:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Een 1e debet prestatie en een identieke credit prestatie mogen niet in &#233;&#233;n bericht (declaratie/factuur) worden aangeleverd. Als de 1e debet en credit prestatie op &#233;&#233;n moment bekend zijn, dan horen die tegen elkaar weg te vallen en niet in &#233;&#233;n bericht te staan.</li><li>Een credit prestatie en een 2e debet prestatie kunnen desgewenst in hetzelfde bericht worden aangeleverd.</ul>&nbsp;<p style=\"margin-top: 3pt;\"><b>Totaal declaratie-/factuurbedrag</b>&nbsp;<p style=\"margin-top: 3pt;\">Het totale declaratie-/factuurbedrag van alle debet en credit prestaties in het bericht wordt ingevuld in DeclaratieFactuurTotaalBedrag in de header van het bericht. Hierbij worden debetbedragen opgeteld en creditbedragen afgetrokken.&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV055"}}}]
}
]
}
