"28409" : {
"id":28409,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR318: Indien iedere DeclaratiePeriode zorg is geleverd, moet DeclaratiePeriode BeginDatum van de volgende declaratie-/factuurperiode precies één dag na de DeclaratiePeriode EindDatum van de voorgaande declaratie-/factuurperiode liggen.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als gedurende &#233;&#233;n of meerdere DeclaratiePerioden door de aanbieder geen zorg is geleverd, zal de DeclaratiePeriode Begindatum van de volgende declaratie/factuur precies 1 of meer keer de duur van de afgesproken DeclaratiePeriode + 1 dag na de DeclaratiePeriode Einddatum van de laatst ingediende declaratie/factuur van dezelfde aanbieder liggen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld:&nbsp;<p style=\"margin-top: 3pt;\"></b>De afgesproken declaratie-/factuurperiode is maandelijks. De duur van de DeclaratiePeriode is dus 1 maand.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">In februari en maart wordt zorg geleverd, die respectievelijk in maart en april wordt gedeclareerd/gefactureerd.&nbsp;<p style=\"margin-top: 3pt;\">In april en mei wordt geen zorg geleverd en hoeven er ook geen correcties op vorige declaraties/facturen te worden ingediend.</span><span style=\" font-size: 10pt; font-family: Arial;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">De facturen die worden verstuurd zullen de volgende DeclaratiePerioden bevatten:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Factuur Maart: 01-03-2019 t/m 31-03-2019</li><li>Factuur April: 01-04-2019 t/m 30-04-2019</li><li>Factuur Juli: 01-07-2019 t/m 31-07-2019 (01-07-2019 is 2 maanden + 1 dag na 30-04-2019)</li><li>Factuur Augustus: 01-08-2019 t/m 31-08-2019</ul>&nbsp;<p style=\"margin-top: 3pt;\"></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CDT_DeclaratieFactuurIdentificatie","id":30604,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR318","niveau":"berichtoverstijgend"}}}]
}
]
}
,
"28414" : {
"id":28414,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV064: Hoe moet het declaratie- of factuurbericht gevuld worden indien achteraf gedeclareerd wordt?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Zorg of ondersteuning geleverd aan een client tijdens een bepaalde declaratie-/factuurperiode wordt direct in de erop volgende declaratie-/factuurperiode of achteraf in een latere declaratie-/factuurperiode gedeclareerd of gefactureerd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer achteraf wordt gedeclareerd of gefactureerd, mag dit niet met een declaratie-/factuurperiode worden gedaan die voor de laatst ingediende declaratie-/factuurperiode ligt. De productperiode zelf mag wel in het verleden liggen, aangezien hiermee de periode van levering wordt aangeduid&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Wanneer achteraf wordt gedeclareerd of gefactureerd over meerdere declaratieperiodes worden in &#233;&#233;n declaratie- of factuurbericht evenveel prestaties opgenomen als het aantal afzonderlijke prestaties dat verzonden zou zijn wanneer deze in afzonderlijke berichten waren opgenomen.&nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Voorbeelden&nbsp;<p style=\"margin-top: 3pt;\"></b>In onderstaande voorbeelden wordt uitgegaan van de volgende situatie:&nbsp;<p style=\"margin-top: 3pt;\"><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Er wordt per maand gedeclareerd/gefactureerd</li><li>De volgende declaratie-/factuurperiodes zijn ingediend:</ul> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* 01-01-2019 t/m 31-01-2019&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* 01-02-2019 t/m 28-02-2019&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* 01-03-2019 t/m 31-03-2019&nbsp;<p style=\"margin-top: 3pt;\"> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* 01-05-2019 t/m 31-05-2019 (In april was er blijkbaar niets te declareren/factureren)&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">1: Achteraf declareren/factureren als een declaratie-/factuurperiode mist&nbsp;<p style=\"margin-top: 3pt;\">In juni blijkt dat in april 2019 toch iets te declareren/factureren was, aangezien in maart 2019 zorg is geleverd aan een Client. Aangezien er al een declaratie-/factuurperiode is ingediend die na April 2019 ligt (namelijk mei 2019), kunnen de nog niet ingediende Prestaties van Maart 2019 worden ingediend met &#233;&#233;n van de volgende declaratie-/factuurperiodes:&nbsp;<p style=\"margin-top: 3pt;\"></li><ul style=\"margin-top: 0pt; margin-bottom: 0pt;\"><li>Als 2e factuur van de maand mei: DeclaratieFactuurPeriode 01-05-2019 t/m 31-05-2019</li><li>Bij de eerstvolgende factuur in juni: DeclaratieFactuurPeriode 01-06-2019 t/m 30-06-2019</ul>&nbsp;<p style=\"margin-top: 3pt;\">2: Achteraf declareren/factureren als de hulpperiode meerdere declaratie-/factuurperiodes beslaat&nbsp;<p style=\"margin-top: 3pt;\">In juni blijkt dat (ononderbroken) geleverde ondersteuning aan een cli&#235;nt tussen 15-02-2018 t/m 30-04-2018 nog niet is gedeclareerd/gefactureerd. Er dient per declaratie-/factuurperiode een Prestatie te worden ingediend. Er volgen in het volgende declaratie-/factuurbericht 3 Prestaties met de volgende ProductPeriodes:&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 1: 15-02-2018 t/m 28-02-2018&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 2: 01-03-2018 t/m 31-03-2018&nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 3: 01-04-2018 t/m 30-04-2018&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span></li>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV064"}}}]
}
]
}
