"28588" : {
"id":28588,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV077: Hoe moet het  maximaal te declareren volume berekend worden over de declaratieperiode bij gebruik van de frequentie per week in de toewijzing?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De frequentie per week is niet 1-op1 passend binnen de declaratieperiode maand. Hierdoor zijn bij de omrekening naar een maximaal te declareren volume over de declaratieperiode (kalendermaand) aanvullende afspraken noodzakelijk, zodat het volume in de prestatie gecontroleerd kan worden. Afhankelijk van de uitvoeringsvarianten zijn hiervoor verschillende rekenmethoden opgesteld. &nbsp;<p style=\"margin-top: 3pt;\"><b>&nbsp;<p style=\"margin-top: 3pt;\">Rekenmethode inspanningsgerichte toewijzing met frequentie per week&nbsp;<p style=\"margin-top: 3pt;\"></b>Het maximale volume wordt bepaald op basis van het aantal (eventueel gebroken) kalenderweken die de declaratieperiode beslaat, binnen de toewijzing. Dit aantal wordt vermenigvuldigd met het volume uit de toewijzing. Voor het bepalen van het aantal kalenderweken, worden de weeknummers geteld. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Om te voorkomen dat deze rekenmethode resulteert in meer ruimte dan totaal toegewezen, moet het totaal volume over alle ingediende prestatieregels ook gecontroleerd worden tegen het maximale volume over de toewijzingsperiode. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Rekenmethode Outputgerichte toewijzing met frequentie per week&nbsp;<p style=\"margin-top: 3pt;\"></b>Het maximale volume van de declaratieperiode wordt bepaald op basis van het aantal zondagen dat binnen de declaratieperiode ligt (plus 1 indien in die declaratieperiode de einddatum van de toewijzing ligt en dit niet op een zondag is). Dit aantal wordt vermenigvuldigd met het volume uit de toewijzing. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld bij inspanningsgerichte toewijzing:&nbsp;<p style=\"margin-top: 3pt;\"></b>Client heeft een toewijzing voor 3 uur per week met &nbsp;ingangsdatum 12-10-2021 en einddatum 28-12-2021&nbsp;<p style=\"margin-top: 3pt;\">Bepaal het aantal kalenderweken in de declaratieperiode binnen de toewijzingsperiode&nbsp;<p style=\"margin-top: 3pt;\">* Oktober: 3 (week 41 t/m 43)&nbsp;<p style=\"margin-top: 3pt;\">* November: 5 (week 44 t/m 48) &nbsp;<p style=\"margin-top: 3pt;\">* December: 5 (week 48 t/m 52)&nbsp;<p style=\"margin-top: 3pt;\">Maximaal volume per declaratieperiode: Vermenigvuldig het aantal kalenderweken per declaratieperiode met het toegewezen volume per week:.&nbsp;<p style=\"margin-top: 3pt;\">* Oktober: 9 uur (3 weken x 3 uur)&nbsp;<p style=\"margin-top: 3pt;\">* November: 15 uur (5 weken x 3 uur)&nbsp;<p style=\"margin-top: 3pt;\">* December: 15 uur (5 weken x 3 uur)&nbsp;<p style=\"margin-top: 3pt;\">Maximaal volume over de toewijzingsperiode: &nbsp;tel het aantal weken (eventueel gebroken) binnen de toewijzing en vermenigvuldig dit met het volume uit de toewijzing:&nbsp;<p style=\"margin-top: 3pt;\">12-10-2021 t/m 28-12-2021 = week 41 t/m week 52 = 12 weken x 3 uur = 36 uur&nbsp;<p style=\"margin-top: 3pt;\">Het maximale volume over de toewijzingsperiode is 36 uur&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"><b>Voorbeeld bij Outputgerichte toewijzing:</b>&nbsp;<p style=\"margin-top: 3pt;\">Client heeft een toewijzing voor 300 euro per week met ingangsdatum 12-10-2021 en einddatum 28-12-2021&nbsp;<p style=\"margin-top: 3pt;\">Het aantal zondagen in de declaratieperiode binnen de toewijzingsperiode:&nbsp;<p style=\"margin-top: 3pt;\">* Oktober: 12-10 t/m 31-10 -&gt; telt 3 zondagen&nbsp;<p style=\"margin-top: 3pt;\">* November: 1-11 t/m 30-11 -&gt; telt 4 zondagen&nbsp;<p style=\"margin-top: 3pt;\">* December: 1-12 t/m 28-12 -&gt; telt 4 zondagen plus 1 = 5 (omdat de einddatum van de toewijzing niet op zondag is, dient er 1 extra zondag te worden geteld&nbsp;<p style=\"margin-top: 3pt;\">Maximaal volume per declaratieperiode: Het aantal zondagen vermenigvuldigd met het volume uit de toewijzing: &nbsp;<p style=\"margin-top: 3pt;\">* Oktober 3 zondagen x 300 euro = 900 euro&nbsp;<p style=\"margin-top: 3pt;\">* November 4 zondagen x 300 euro = 1200 euro&nbsp;<p style=\"margin-top: 3pt;\">* December 5 zondagen x 300 euro = 1500euro&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV077"}}}]
}
]
}
