"name":"TR376: Het DeclaratieNummer dient overeen te komen met het DeclaratieNummer van een eerder ontvangen Declaratie.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Bij iedere goed of (deels) afgekeurde Declaratie is het Declaratie-antwoord gerelateerd aan een ingediende declaratie o.b.v. DeclaratieNummer. Een goed of (deels) afgekeurde declaratie wordt middels een Declaratie-antwoordbericht verstuurd en is een functionele/inhoudelijke reactie. </span><span style=\" font-size: 10pt; font-family: Verdana;\"></span><span style=\" font-size: 11pt; font-family: Verdana;\">&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO325","id":28732,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW325","id":29539,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR376"}}}]
