"lang":"nl",
"name":"TR352: Bij een verzoek om wijziging komt minstens 1 OngewijzigdProduct of TeWijzigenProduct voor.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een verzoek om wijziging bericht is gebaseerd op een situatie waarbij er minstens 1 actuele toewijzing is. &nbsp;<p style=\"margin-top: 3pt;\">In het bericht moet daarom minstens 1 product zitten dat ongewijzigd blijft of gewijzigd moet worden, aangezien alle op Ingangsdatum geldige of in de toekomst geldige ToegewezenProducten voor die betreffende aanbieder/client in het verzoek om wijziging bericht moeten worden opgenomen&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO317","id":28963,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW317","id":29044,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR352","niveau":"standaard"}}}]
