"28894" : {
"id":28894,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV078: Wat mag gedeclareerd worden wanneer een onvolledige periode is toegewezen?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Alleen voor de inspanningsgerichte uitvoeringsvariant is een uniforme werkwijze geformuleerd. Voor de outputgerichte uitvoeringsvariant is het aan de gemeente om gezamenlijk met de aanbieder te komen tot een afspraak hierover. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Werkwijze voor inspanningsgerichte uitvoeringsvariant, het in de gebroken periode daadwerkelijk geleverde volume wordt gedeclareerd. Met als bovengrens voor deze gebroken periode het maximale volume, dat in ToegewezenProduct aan de frequentie is toegekend. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 1:&nbsp;<p style=\"margin-top: 3pt;\">frequentie in ToegewezenProduct = week&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">Toewijzing voor 3 uur per week met ingangsdatum 12-10-2021 en einddatum 13-12-2021&nbsp;<p style=\"margin-top: 3pt;\">Voor de &nbsp;productperiode 12-10-2021 t/m 31-10-2021 mag maximaal 9 uur gedeclareerd worden, indien deze uren ook daadwerkelijk geleverd zijn. (zie ook rekenmethode IV077 De eerste week (12-10-2021 t/m 17-10-2021) is geen volledige kalenderweek, maar indien geleverd mag voor deze week de volledige 3 uur worden gedeclareerd. &nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld 2:&nbsp;<p style=\"margin-top: 3pt;\">Frequentie in ToegewezenProduct = maand&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">Toewijzing voor 15 uur per maand met ingangsdatum 12-10-2021 en einddatum 13-12-2021&nbsp;<p style=\"margin-top: 3pt;\">Voor de productperiode 12-10-2021 t/m 31-10-2021 mag maximaal 15 uur gedeclareerd worden, indien deze uren ook daadwerkelijk geleverd zijn. Ondanks dat de ingangsdatum 12-10-2021 is en er dus geen hele kalendermaand is toegewezen, mag (mits geleverd) de volledige 15 uur gedeclareerd worden.</span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV078"}}}]
}
]
}
