"28191" : {
"id":28191,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV058: Hoe moet de prestatie gevuld worden wanneer hetzelfde product meer dan één keer op een dag aan een client is geleverd?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Bij meerdere identieke producten op &#233;&#233;n dag, waarbij alle overige declaratie-/factuur-inhoudelijke gegevens identiek zijn, moet dit in het declaratie- of factuurbericht worden samengevoegd tot &#233;&#233;n berichtklasse prestatie (met als aantal het desbetreffende aantal). &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO303","id":28222,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW303","id":29743,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV058"}}}]
}
]
}
,
"28175" : {
"id":28175,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR300: Indien de toewijzing wordt gestuurd naar aanleiding van het honoreren van een verzoek om toewijzing bericht, moet ReferentieAanbieder worden overgenomen van het betreffende verzoek om toewijzing bericht (315).",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Alleen als een toewijzing wordt gestuurd als honorering van een verzoek, dan wordt ReferentieAanbieder overgenomen uit het verzoek. &nbsp;<p style=\"margin-top: 3pt;\">Als een toewijzing wordt gestuurd op initiatief van de gemeente wordt ReferentieAanbieder niet gevuld.&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld: na een verzoek om toewijzing wordt een toewijzing gestuurd, deze bevat dan ReferentieAanbieder. &nbsp;<p style=\"margin-top: 3pt;\">Na verloop van tijd stuurt de gemeenten op haar initiatief een gewijzigde toewijzing, bijvoorbeeld met een Einddatum ingevuld. Deze gewijzigde toewijzing heeft dan geen ReferentieAanbieder omdat het geen honorering van een verzoek is.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Times New Roman;\"></span><span style=\" font-family: Times New Roman;\">&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR300","niveau":"berichtoverstijgend"}}}]
}
]
}
