"28228" : {
"id":28228,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP344: Een verzoek wordt door de gemeente uiteindelijk beantwoord met een toewijzing of een afwijzing.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een verzoek om toewijzing of verzoek om wijziging bevat 1 of meerdere toe te wijzen of te wijzigen producten. &nbsp;<p style=\"margin-top: 3pt;\">De gemeente reageert hierop met een of meer toegewezen producten in een toewijzingbericht, &nbsp;<p style=\"margin-top: 3pt;\">of geeft met een antwoordbericht te kennen dat het verzoek wordt afgewezen.&nbsp;<p style=\"margin-top: 3pt;\">Eventueel is er eerst onderzoek nodig voordat wordt toegewezen of afgewezen.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">Bij een verzoek om wijziging is de reactie van de gemeente altijd op het niveau van het complete verzoek,&nbsp;<p style=\"margin-top: 3pt;\">bij een verzoek om toewijzing kan de gemeente besluiten om elk aangevraagd product apart al dan niet te honoreren.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO319","id":28543,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW319","id":29533,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP344"}}}]
}
]
}
