"28266" : {
"id":28266,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP289: Bij een toegewezen product kan slechts één Startbericht actueel zijn.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Op ieder moment kan er maar &#233;&#233;n begindatum zijn van een levering die gestart is naar aanleiding van &#233;&#233;n toegewezen product of productcategorie. Een startbericht kan dus nooit volgen op een startbericht voor hetzelfde toegewezen product, tenzij er voor dat toegewezen product een (tijdelijke) beeindiging is doorgegeven in een stopbericht, &#243;f tenzij het een correctie betreft van het eerdere startbericht (zie IV008). &nbsp;<p style=\"margin-top: 3pt;\">Let op: een product kan hierbij niet gevuld zijn (generiek) of bestaan uit alleen een productcategorie (aspecifiek) ofwel een productcategorie en een productcode (specifiek).&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW307","id":29164,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO307","id":29997,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP289"}}}]
}
]
}
