"29064" : {
"id":29064,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV084: Hoe moet de declaratie gevuld worden wanneer sprake is van elkaar opvolgende toewijzingen binnen 1 declaratieperiode?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Als sprake is van elkaar opvolgende toewijzingen binnen een declaratieperiode, dan volgen aparte Prestaties per toewijzing en per product in de declaratie over die declaratieperiode. Een Prestatie kan dus nooit op meer dan 1 toewijzing betrekking hebben. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Voorbeeld &nbsp;<p style=\"margin-top: 3pt;\">In onderstaand voorbeeld wordt uitgegaan van de volgende situatie: &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* De eerste toewijzing heeft Ingangsdatum 01-03-2021 en Einddatum 09-03-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* De opvolgende toewijzing heeft Ingangsdatum 23-03-2021 en Einddatum 31-03-2021&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* Er is ononderbroken zorg geleverd gedurende beide toegewezen periodes&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Er worden nu 2 Prestaties ingediend met de volgende ProductPeriodes: &nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 1: 01-03-2021 t/m 09-03-2021 &nbsp;<p style=\"margin-top: 3pt;\">ProductPeriode Prestatie 2: 23-03-2021 t/m 31-03-2021 &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV084"}}}]
}
]
}
