"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Deze regel is van toepassing op di&#233; situaties waarin de aanbieder niet had kunnen weten dat hij geen ondersteuning meer mocht leveren.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP186","geen technische regels":false}}}]
