"29180" : {
"id":29180,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP308: Een aanbieder vraagt met een verzoek om wijziging bericht een samenhangend geheel aan toewijzingen aan met daarin de volledige gewenste situatie.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Wanneer de aanbieder constateert dat de situatie van de cli&#235;nt verandert gedurende het leveren van zorg/ondersteuning, waardoor er een ander pakket aan zorg of ondersteuning nodig is, dan wordt dit kenbaar gemaakt met een verzoek om wijziging bericht, waarin de complete gewenste nieuwe situatie (van ongewijzigde, gewijzigde en of nieuw gewenste producten of productcategorien) wordt aangegeven. </span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO317","id":28963,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW317","id":29044,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP308"}}}]
}
]
}
,
"29182" : {
"id":29182,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP270: Aanbieder en gemeente maken onderling afspraken over de door te geven begin- en einddatum in de regieberichten.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het gebruik van de regieberichten is voor de uitvoeringsvarianten inspannings- en outputgericht verplicht (met uitzondering van voor de Gecertificeerde Instellingen). Gemeente en aanbieder maken onderling afspraken welke datums gehanteerd moeten worden om de start en stop van de levering door te geven. Deze afspraak kan per product afwijken, maar dit heeft niet de voorkeur.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO305","id":28387,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW307","id":29164,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW305","id":29812,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"WMO307","id":29997,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP270","geen technische regels":false}}}]
}
]
}
,
"29177" : {
"id":29177,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV007: Hoe wordt de naam van een client of relatie vastgelegd?`",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Van een client of relatie worden de achternaam, voorvoegsel en voornamen en/of voorletters gescheiden vastgelegd. Voor het vastleggen van de VolledigeNaam van een client geldt het volgende format: &nbsp;<p style=\"margin-top: 3pt;\">* De Geslachtsnaam wordt altijd vastgelegd. Deze bestaat uit de Naam en eventueel een Voorvoegsel; &nbsp;<p style=\"margin-top: 3pt;\">* De Partnernaam kan worden vastgelegd. Ook deze bestaat uit de Naam en eventueel een Voorvoegsel; &nbsp;<p style=\"margin-top: 3pt;\">* Voornamen kunnen worden vastgelegd, gescheiden door spaties; &nbsp;<p style=\"margin-top: 3pt;\">* Voorletters kunnen worden vastgelegd, aaneengesloten, zonder punten of spaties; &nbsp;<p style=\"margin-top: 3pt;\">* NaamGebruik geeft de gewenste aanspreekvorm aan. Hiermee wordt bij correspondentie de volgorde bepaald in het gebruik van de geslachtsnaam en de naam van de partner. Het vullen van NaamGebruik hangt dus af van hoe de client of relatie zijn/haar naam hanteert.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO301","id":29618,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW301","id":29203,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV007"}}}]
}
]
}
,
