"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">Indien de ProductCategorie in de Toewijzing gevuld is, dan moet in het declaratiebericht in de Prestatie de toegewezen ProductCategorie overgenomen worden. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 9pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO323","id":28554,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW323","id":29834,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR339"}}}]
