"29348" : {
"id":29348,
"typeIconPath":"data/icons/ArchiMate/MotivationConstraint.png",
"data" : [
{
"lang":"nl",
"name":"TR349: Het verzoek om wijziging bericht bevat alle actuele ToegewezenProducten van de client",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het verzoek om wijziging bericht bevat alle actuele toegewezen producten van de client, hetzij in OngewijzigdProduct, hetzij in TeWijzigenProduct&nbsp;<p style=\"margin-top: 3pt;\">Actuele toewijzingen zijn toewijzingen die op of na de huidige datum geldig zijn, of waarvan de ingangsdatum in de toekomst ligt. &nbsp;<p style=\"margin-top: 3pt;\">Alle actuele toewijzingen zijn terug te vinden, hetzij als OngewijzigdProduct, hetzij als TeWijzigenProduct.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO317","id":28963,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW317","id":29044,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_Retourcode-Wmo/Jw","id":30598,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR349"}}}]
}
]
}
