"lang":"nl",
"name":"OP306: Het verzoek om wijziging bericht wordt gebruikt als tijdens levering van zorg en/of ondersteuning blijkt dat een ander pakket van toegewezen producten nodig is",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een verzoek om wijziging bericht wordt altijd verstuurd vanuit een situatie waarbij er al geleverd wordt op basis van een of meer actuele toewijzingen. &nbsp;<p style=\"margin-top: 3pt;\">Het bericht bevat altijd de complete gewenste situatie inclusief de ongewijzigde, gewijzigde en nieuwe toewijzingen.&nbsp;<p style=\"margin-top: 3pt;\">Een verzoek om wijziging bericht kan niet gebruikt worden als er geen actuele toewijzing is. &nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"WMO317","id":28963,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"JW317","id":29044,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP306"}}}]
