"name":"Casus 06: Trajectfinanciering",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Deze casus beschrijft een voorbeeld van trajectfinanciering, waarbij gemeente en aanbieder afspreken dat 70% aan het begin van het traject mag worden gedeclareerd en 30% aan het eind.</span><span style=\" font-size: 10pt; font-family: Verdana;\"></span><span style=\" font-size: 9pt; font-family: Verdana;\">&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
