"typeIconPath":"data/icons/ArchiMate/AllView.png",
"data" : [
{
"lang":"nl",
"name":"Casus 10: Aspecifieke toewijzing met regieberichten",
"type":"Totaalview classic",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Deze casus beschrijft het aspecifiek toewijzen met aspecifieke start- en stopberichten. De cli&#235;nt geeft na enige tijd aan de behandeling te willen stoppen. Hierop volgt een stopbericht en een intrekking van de toewijzing.</span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
