,
"45454" : {
"id":45454,
"typeIconPath":"data/icons/ArchiMate/BusinessProcess.png",
"data" : [
{
"lang":"nl",
"name":"Monitoren",
"type":"Bedrijfsproces",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien een cli&#235;nt voor langere tijd geen ondersteuning ontvangt, bijvoorbeeld in het geval van een ziekenhuisopname, kan dit in het berichtenverkeer worden doorgegeven als een tijdelijke be&#235;indiging van de ondersteuning. De aanbieder houdt contact met de cli&#235;nt. Indien de ondersteuning weer hervat wordt, stuurt de aanbieder opnieuw een Startbericht. Dit Startbericht is gerelateerd aan de oorspronkelijke toewijzing. Indien de levering niet meer hervat wordt, stuurt de aanbieder nogmaals een Stopbericht. Dit Stopbericht is gerelateerd aan het oorspronkelijke Startbericht, maar bevat een reden voor de definitieve be&#235;indiging (zie hiervoor codelijst WMO588: Reden Be&#235;indiging).&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Gebruikmaken van deze functionaliteit dient in samenspraak met gemeente en aanbieder plaats te vinden. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"></span>"}}]
}
]
}
