"49181" : {
"id":49181,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 5: Stop Jeugdhulp   Vanaf oktober 2021 komt Tom niet meer opdagen voor zijn behandeling bij Duinzicht. Omdat het niet lukt Tom over te halen om terug te komen, stuurt de aanbieder eind oktober een Stop bericht aan de gemeente om aan te geven dat de levering gestopt is.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"49182" : {
"id":49182,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 1: Beschikking en toewijzing Jeugdhulp  De gemeente heeft in een beschikking vastgesteld dat Tom de Wit recht heeft op Jeugdhulp met verblijf, inclusief behandeling. Op basis van deze beschikking wijst de gemeente de te leveren ondersteuning toe aan  zorgcentrum Duinzicht. Met deze aanbieder is  afgesproken dat zij voor Jeugdhulp met verblijf een vast tarief per maand rekenen.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"49183" : {
"id":49183,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 3: Declaratie Jeugdhulp outputgericht  De aanbieder stuurt maandelijks een declaratie aan  de gemeente voor de geleverde ondersteuning.  Begin juni levert de aanbieder de declaratie aan over  mei 2021.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"49185" : {
"id":49185,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 6: Gemeente sluit beschikking en toewijzing  De gemeente besluit na ontvangst van het Stopbericht de beschikking en de toewijzing in haar systeem af te sluiten. De gemeente informeert de aanbieder over deze wijziging van de toewijzing door verzending van een intrekkingbericht.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"49186" : {
"id":49186,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 4: Declaratie beoordelen en antwoord sturen  De gemeente beoordeeld de declaratie en stuurt een declaratie-antwoordbericht naar de aanbieder. De gemeente vindt de declaratie akkoord, de ingediende prestatie wordt toegewezen.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
,
"49184" : {
"id":49184,
"typeIconPath":"data/icons/ArchiMate/BusinessFunction.png",
"data" : [
{
"lang":"nl",
"name":"Stap 2: Start Jeugdhulp  Jeugdhulp Aanbieder Duinzicht stelt na het ontvangen van de toewijzing een zorgplan op in overleg met Tom en zijn vader, die gezagsdrager is.  Vanaf 6 mei kan Tom terecht voor zijn interne  behandeling bij Duinzicht. De aanbieder stuurt bij  de start van de levering een Start bericht aan de  gemeente.",
"type":"Bedrijfsfunctie",
"categories":[]
}
]
}
