"52950" : {
"id":52950,
"typeIconPath":"data/icons/ArchiMate/ViewGraphic.png",
"data" : [
{
"lang":"nl",
"name":"De keten van Wmo processen start op het moment dat een client een aanvraag doet voor ondersteuning bij de  gemeente waar hij staat ingeschreven.  Als de aanvraag voor ondersteuning wordt toegekend aan de client wordt er een beschikking aangemaakt. De  gemeente (of een Wmo-uitvoerder namens de gemeente) stuurt hierop een opdracht tot levering van hulp  (toeleiden) naar een aanbieder waar hij de hulp heeft ingekocht. De geleverde Wmo-ondersteuning (levering)  wordt gedeclareerd bij de gemeente volgens de geldende contractafspraken (financiering).  Gegevensuitwisseling binnen de processen beoordelen, toeleiden en financiering is van belang om de  rechtmatigheid van de te leveren zorg en ondersteuning vast te kunnen stellen. Gegevensuitwisseling  rondom het proces leveren is van belang om regie te voeren op het daadwerkelijk plaatsvinden van zorg  en ondersteuning.",
"type":"Tekenvorm",
"categories":[]
}
]
}
